//CrabAlertPercentage should be a number from 0-100, decimals can be used.
var CrabAlertPercentage = 1;
if ((Math.random() * 100) < CrabAlertPercentage) {
	document.body.insertAdjacentHTML('afterend', `
	<style>
		.crab__alert, .crab__alert * {
			all: initial;
		}
	</style>
	<link href="https://fonts.googleapis.com/css2?family=Anton&display=swap" rel="stylesheet">
	<div onmouseover="this.remove()" class="crab__alert" id="c r a b  a l e r t" style="filter: opacity(0); left: 0.5vw; width: 300px; background: whitesmoke; border: 0.1vw solid orangered; height: 130px; position: fixed; bottom: 0.5vw; z-index: 1000;">
		<img style="height: 130px; float: right;" src="data:image/png;base64,"></img>
		<p style="padding: 4px; display: table-cell; font-size: 27px; font-family: 'Anton', sans-serif;">You are not immune to Carcinisation</p>
	</div>`)
	
	setTimeout(function(){
		document.fonts.ready.then(function () {
			document.getElementById('c r a b  a l e r t').style.filter = ""
		});
	}, 5000);
}